import React from 'react';
import DataCard from './DataCard';

function Dashboard({
  burnedAmount,
  treasuryAmount,
  royaltiesAmount,
  totalVolume,
  burnedPercentage,
  treasuryPercentage,
  royaltiesPercentage,
  loading,
  lastSync,
  userStats,
  tokenStats,
  uniqueCreators,
  range,
  rangeUsers,
  rangeTokens,
  rangeCreators
}) {
  return (
    <main className="dashboard">
      <DataCard
        title="Burned Amount"
        value={burnedAmount}
        unit="PUF"
        percentage={burnedPercentage}
        cardType="burned"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Sent to Treasury"
        value={treasuryAmount}
        unit="PUF"
        percentage={treasuryPercentage}
        cardType="treasury"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Creator Royalties Distributed"
        value={royaltiesAmount}
        unit="WLD"
        percentage={royaltiesPercentage}
        cardType="royalties"
        loading={loading}
        lastSync={lastSync}
        totalVolume={totalVolume}
      />

      <DataCard
        title="Total Users"
        value={userStats?.total || 0}
        unit="users"
        percentage=""
        cardType="users"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Users This Month"
        value={userStats?.monthly || 0}
        unit="users"
        percentage=""
        cardType="users-monthly"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Total Tokens"
        value={tokenStats?.total || 0}
        unit="tokens"
        percentage=""
        cardType="tokens"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Tokens This Month"
        value={tokenStats?.monthly || 0}
        unit="tokens"
        percentage=""
        cardType="tokens-monthly"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title="Unique Creators"
        value={uniqueCreators || 0}
        unit="creators"
        percentage=""
        cardType="creators"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title={`Tokens & Real Humans (${range})`}
        value={rangeTokens || 0}
        unit={`tokens • ${rangeCreators || 0} creators`}
        percentage=""
        cardType="range-tokens-creators"
        loading={loading}
        lastSync={lastSync}
      />

      <DataCard
        title={`Users (${range})`}
        value={rangeUsers || 0}
        unit="users"
        percentage=""
        cardType="range-users"
        loading={loading}
        lastSync={lastSync}
      />
    </main>
  );
}

export default Dashboard;
